import React, { Component } from 'react';
import CanvasJSReact from '../../assets/canvasjs.react';
var CanvasJSChart = CanvasJSReact.CanvasJSChart;
 
const divStyle = {
	height: '550px',
	width : '950px',
	backgroundColor: '#FFFFFF',
	resize: 'horizontal',
	overflow: 'auto'
};

const divStyle2 = {
	height: '550px',
	width: '400px',
	backgroundColor: '#383837',
	resize: 'horizontal',
	overflow: 'auto'
};

const parentdivStyle = {
	backgroundColor : '#E6E6E6'
}  

class LineChart extends Component {
	constructor(props){
		super(props);
		this.state = {
			data : [

			]
		}
	}


	render() {
		const options = {
			animationEnabled: true,
			theme: "light2",
			title:{
				text: "Transformer"
			},
			width: 400,
			height: 100,
			axisY: {
				title: "",
				includeZero: false
			},
			axisX: {
				title: "",
				prefix: "",
				interval: 6,
				intervalType : "hour",
				valueFormatString: "hh:mm tt"
			},
			data: [{
				type: "line",
				color: "#6D2A00",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 2600 }, 
					{ x: new Date(2020,1,19,9), y: 1900 }, 
					{ x: new Date(2020,1,19,12), y: 2800 }, 
					{ x: new Date(2020,1,19,15), y: 5300 }, 
					{ x: new Date(2020,1,19,18), y: 2400 }, 
					{ x: new Date(2020,1,19,21), y: 3900 }, 
					{ x: new Date(2020,1,19,24), y: 2200 }, 
					{ x: new Date(2020,1,20,3), y: 4000 }, 
					{ x: new Date(2020,1,20,6), y: 5100 }, 
					{ x: new Date(2020,1,20,9), y: 1700 }
				]
			},
			{
				type: "line",
				color: "#2C2C2D",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 1400 }, 
					{ x: new Date(2020,1,19,9), y: 2800 }, 
					{ x: new Date(2020,1,19,12), y: 2900 }, 
					{ x: new Date(2020,1,19,15), y: 4000 }, 
					{ x: new Date(2020,1,19,18), y: 5200 }, 
					{ x: new Date(2020,1,19,21), y: 2800 }, 
					{ x: new Date(2020,1,19,24), y: 3900 }, 
					{ x: new Date(2020,1,20,3), y: 4400 }, 
					{ x: new Date(2020,1,20,6), y: 3100 }, 
					{ x: new Date(2020,1,20,9), y: 2200 }
				]
			},
			{
				type: "line",
				color: "#B1B1B9",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 2500 }, 
					{ x: new Date(2020,1,19,9), y: 1600 }, 
					{ x: new Date(2020,1,19,12), y: 1800 }, 
					{ x: new Date(2020,1,19,18), y: 6300 }, 
					{ x: new Date(2020,1,19,21), y: 1400 }, 
					{ x: new Date(2020,1,19,24), y: 1900 }, 
					{ x: new Date(2020,1,20,3), y: 2100 }, 
					{ x: new Date(2020,1,20,6), y: 4100 }, 
					{ x: new Date(2020,1,20,9), y: 1800 }
				]
			}]
		}

		const segment_options = {
			animationEnabled: true,
			theme: "light2",
			title:{
				text: "Transformer"
			},
			width: 400,
			height: 100,
			axisY: {
				title: "",
				includeZero: false
			},
			axisX: {
				title: "",
				prefix: "",
				interval: 6,
				intervalType : "hour",
				valueFormatString: "hh:mm tt"
			},
			data: [{
				type: "line",
				color: "#6D2A00",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 2600 }, 
					{ x: new Date(2020,1,19,9), y: 1900 }, 
					{ x: new Date(2020,1,19,12), y: 2800 }, 
					{ x: new Date(2020,1,19,15), y: 5300 }, 
					{ x: new Date(2020,1,19,18), y: 2400 }, 
					{ x: new Date(2020,1,19,21), y: 3900 }, 
					{ x: new Date(2020,1,19,24), y: 2200 }, 
					{ x: new Date(2020,1,20,3), y: 4000 }, 
					{ x: new Date(2020,1,20,6), y: 5100 }, 
					{ x: new Date(2020,1,20,9), y: 1700 }
				]
			},
			{
				type: "line",
				color: "#2C2C2D",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 1400 }, 
					{ x: new Date(2020,1,19,9), y: 2800 }, 
					{ x: new Date(2020,1,19,12), y: 2900 }, 
					{ x: new Date(2020,1,19,15), y: 4000 }, 
					{ x: new Date(2020,1,19,18), y: 5200 }, 
					{ x: new Date(2020,1,19,21), y: 2800 }, 
					{ x: new Date(2020,1,19,24), y: 3900 }, 
					{ x: new Date(2020,1,20,3), y: 4400 }, 
					{ x: new Date(2020,1,20,6), y: 3100 }, 
					{ x: new Date(2020,1,20,9), y: 2200 }
				]
			},
			{
				type: "line",
				color: "#B1B1B9",
				dataPoints: [
					{ x: new Date(2020,1,19,6), y: 2500 }, 
					{ x: new Date(2020,1,19,9), y: 1600 }, 
					{ x: new Date(2020,1,19,12), y: 1800 }, 
					{ x: new Date(2020,1,19,18), y: 6300 }, 
					{ x: new Date(2020,1,19,21), y: 1400 }, 
					{ x: new Date(2020,1,19,24), y: 1900 }, 
					{ x: new Date(2020,1,20,3), y: 2100 }, 
					{ x: new Date(2020,1,20,6), y: 4100 }, 
					{ x: new Date(2020,1,20,9), y: 1800 }
				]
			}]
		}
		
		return (
		<div style={parentdivStyle}>
			<table>
				<tbody>
					<tr>
						<td>
							<div style={divStyle}>
								<div><span>&nbsp;&nbsp;&nbsp;&nbsp;</span></div>
								{/* <CanvasJSChart options = {options} /> */}
							</div>
						</td>

						<td>
							<div align="left" style={divStyle2}>
								<CanvasJSChart options = {options} />
								<div align="left">Segment </div>
								<CanvasJSChart options = {segment_options} />
							</div>
						</td>
					</tr>
				</tbody>
			</table>
		</div>
		);
	}
}

export default LineChart;
